import React from 'react';

const DemoList = (props) => {
    const sortedList = props.items.sort((a,b)=>a-b);
    console.log('hi ',sortedList)
    return (
        <div>
            <h2>{props.title}</h2>
            <ul className='text-align: center;'>
                {sortedList.map((item) =>{
                    
                    <li key={item}>{item}</li>
                })}
            </ul>
        </div>
    )
}

export default DemoList
